import 'react-native-gesture-handler';
import {NavigationContainer} from '@react-navigation/native';
import {createBottomTabNavigator} from '@react-navigation/bottom-tabs';
import { StyleSheet, StatusBar, View} from 'react-native';

import HomeScreen from './src/Componentes/HomeScreen';
// import Produtos from './Componentes2/Produtos';
// import Detalhes from './Componentes2/Detalhes';

const Tab = createBottomTabNavigator();

export default function App() {
  return (
    <NavigationContainer>
      <StatusBar/>
      <Tab.Navigator initialRouterName='Home'>
        <Tab.Screen name='Home' component={HomeScreen}/>
        <Tab.Screen name='Produtos' component={Produtos}/>
        <Tab.Screen name='Detalhes' component={Detalhes}/>

      </Tab.Navigator>

  </NavigationContainer>
  );
}
